import React from "react";
import Background from "./img/istockphoto-1092571024-612x612.jpg";

var sectionStyle = {
    width: "100%",
    height: "100%",
    backgroundImage: "url(" + { Background } + ")"
  };

export default function Login()
{
    return <div class="container-fluid row col-12 login" styles={{ backgroundImage:`url(${Background})` }}>
     
    </div>
}
